          "description": {
              "text": "The Best Open Mic + Jam Session in the city is still going strong. More space, more vendors, and the same Good Food, Good Music, & Good Vibes! \nSoulful Sundays Recap Video\nFREE w/RSVP No Lines, No Hollywood BS. This is Southern Hospitality with West Coast weather.  The place will fill up fast so come early!  \nSponsored by Karma Tequila\nOPEN MIC RULES-If you want to sign up for the open mic follow our IG @soulfulofnoise.  The sign up sheet will be posted the day of the event.  Bring your music on a flash drive.  The Dj plays your record and our house band, The Noise, will learn your music on the spot.  The Dj cuts the track and you perform with the band.  Each artist is allowed to perform ONE record, and if the crowd wants to hear more then by all means keep them entertained!  \nCLOTHING DRIVE FOR SKID ROW-Please Bring Lightly Used Clothing for our Charity Clothing Drive to help the men and women on Skid Row who need them most.  All Donations will go to My Friends House Charity on Skid Row. Thank You For Your Love & Support!\nFor more info & events visit: www.soulfulofnoise.com",
              "html": "<P><SPAN>The Best Open Mic + Jam Session in the city is still going strong. More space, more vendors, and the same <STRONG>Good Food, Good Music, &amp; Good Vibes! </STRONG></SPAN></P>\n<P><STRONG><A HREF=\"https://www.youtube.com/watch?v=NlPJneQP5v0&t=3s\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Soulful Sundays Recap Video</A><BR></STRONG></P>\n<P><SPAN><STRONG>FREE w/RSVP </STRONG></SPAN>No Lines, No Hollywood BS. This is Southern Hospitality with West Coast weather.  The place will fill up fast so come early!  </P>\n<P><SPAN>Sponsored by Karma Tequila</SPAN></P>\n<P><STRONG>OPEN MIC RULES-</STRONG>If you want to sign up for the open mic follow our IG @soulfulofnoise.  The sign up sheet will be posted the day of the event.  Bring your music on a flash drive.  The Dj plays your record and our house band, The Noise, will learn your music on the spot.  The Dj cuts the track and you perform with the band.  Each artist is allowed to perform <STRONG>ONE</STRONG> record, and if the crowd wants to hear more then by all means keep them entertained!  </P>\n<P><STRONG>CLOTHING DRIVE FOR SKID ROW-Please Bring Lightly Used Clothing for our Charity Clothing Drive to help the men and women on Skid Row who need them most.  All Donations will go to My Friends House Charity on Skid Row. Thank You For Your Love &amp; Support!</STRONG></P>\n<P>For more info &amp; events visit: <A HREF=\"http://www.soulfulofnoise.com\" TARGET=\"_blank\" TITLE=\"www.soulfulofnoise.com\" REL=\"nofollow noopener noreferrer\">www.soulfulofnoise.com</A></P>"
          },
