              "html": "<H3>REGAIN THE FORCE IN YOUR MUSIC CAREER. LIVE SHOWCASES AND PANELS W/SIGNED ARTIST, PUBLICITY AGENCIES, RADIO PROMOTERS, MANAGERS AND A POWERFUL KEYNOTE ADDRESSES BY A FORMER A&R DIRECTOR AND NIECE TO A CIVIL RIGHTS LEADER.</H3>\n<P>Schedule:</P>\n<H3>FRIDAY:</H3>\n<H3><BR></H3>\n<H3>REGISTRATION: 4-5:30PM:<BR></H3>\n<H3><SPAN>RED CARPET MIXER: 5:30-6:45PM</SPAN></H3>\n<H3>WELCOME MESSAGE: 7PM</H3>\n<H3>SHOWCASE ONE: 7:15 -7:45PM</H3>\n<H3>KEYNOTE ADDRESS ON RADIO: 7:45 - 8:15PM</H3>\n<H3>SHOWCASE TWO: 8:15 -8:45PM</H3>\n<H3>KEYNOTE ADDRESS: 8:45 -9:30PM</H3>\n<H3>SHOWCASE THREE: 9:30 -10:10PM</H3>\n<H3>COMEDY SHOW: 10:30 - 11PM</H3>\n<H3><BR></H3>\n<H3><STRONG>SATURDAY:</STRONG></H3>\n<P><STRONG></STRONG><BR></P>\n<H3>SHOWCASE FOUR: 10 - 10:30AM</H3>\n<H3>PANEL ON PUBLICITY: 10:30 - 11:10AM</H3>\n<H3>SHOWCASE FIVE: 11:10 - 11:30AM<BR></H3>\n<H3>PANEL ON BEING INDEPENDENT: 11:40AM -12:20PM</H3>\n<H3>PANEL ON RADIO AIRPLAY: 12:50 - 1:30PM<BR></H3>\n<H3>SHOWCASE SIX: 1:30 - 2PM</H3>\n<H3>PANEL ON TOURING: 2 -2:45PM</H3>\n<H3>SHOWCASE SEVEN: 3:05 -3:55PM</H3>\n<H3>PANEL ON THE MUSIC BUSINESS: 4:05 - 4:50PM</H3>\n<H3>SHOWCASE EIGHT: 4:50 - 5:20PM</H3>\n<H3>DINNER BREAK: 5:20 - 7PM</H3>\n<H3>VIP RECEPTION: 5:30 - 6:30PM</H3>\n<H3>KEYNOTE ADDRESS: 7:05 -7:45PM</H3>\n<H3>SHOWCASE NINE: 7:50 -8:20PM</H3>\n<H3>KEYNOTE INTRODUCTION: 8:20 - 8:30PM</H3>\n<H3>MAIN KEYNOTE ADDRESS: 8:30 -9:45PM</H3>\n<H3>SHOWCASE WINNER PERFORMANCE: 9:45 -10PM</H3>\n<P><BR></P>\n<P>Confirmed Speakers (Full line up of Speakers and Panelist announced on September 30th)</P>\n<P><A HREF=\"http://MatthewRix.com\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">Matthew Rix</A> is a former A&R Director, Music business success coach &amp; host of the 8 million sale and stream music business series \"Mattrix Minute\".</P>\n<P>Alveda King is an Author, Speaker, Activist and niece of Dr. Martin Luther King, Jr. </P>\n<P><BR></P>"
