          "name": {
              "text": "2019 LA Beer Fest",
              "html": "2019 LA Beer Fest"
          },
          "description": {
              "text": "The 11th annual LA Beer Festival follows last year's sold out event, and this year's promises to be even better. The event will feature dozens of international and domestic beers, over a dozen food trucks (food sold separately) as well as live entertainment.\nThe 2019 LA Beer Festival will take place at LA Center Studios Studios from noon to 3pm and 5pm to 8pm. Admission is for only one session so make sure to coordinate with friends before buying your ticket. You GA tickets include unlimited beer tastings with food sold separately. Connoisseur's Ticket ($85) are limited and offer attendees exclusive air conditioned bathrooms, taco bar, an indoor/outdoor event deck overlooking the event featuring limited beers/one-offs not available to general admission.\nFor more information, visit www.labeerfest.la\nThe LA Beer Festival's proceeds will benefit Noah's B-ark, Inc (tax ID 95-4677862) whose aim is to rescue dogs from shelters and find permanent homes for rescued pets. Proceeds from the event will towards funding food, shelter, and veterinary bills for rescued pets.\n****************************\nBefore you buy your ticket, make sure you're buying tickets to the right session. Tickets can NOT be exchanged for another session 3/30/18. Tickets are non refundable.  Event is strictly 21 and over. No exceptions. Event is RAIN OR SHINE! \n***************************\n",
              "html": "<P>The 11th annual LA Beer Festival follows last year's sold out event, and this year's promises to be even better. The event will feature dozens of international and domestic beers, over a dozen food trucks (food sold separately) as well as live entertainment.</P>\n<P>The 2019 LA Beer Festival will take place at LA Center Studios Studios from noon to 3pm and 5pm to 8pm. Admission is for only one session so make sure to coordinate with friends before buying your ticket. You GA tickets include unlimited beer tastings with food sold separately. Connoisseur's Ticket ($85) are limited and offer attendees exclusive air conditioned bathrooms, taco bar, an indoor/outdoor event deck overlooking the event featuring limited beers/one-offs not available to general admission.</P>\n<P>For more information, visit www.labeerfest.la<BR></P>\n<P>The LA Beer Festival's proceeds will benefit Noah's B-ark, Inc (tax ID 95-4677862) whose aim is to rescue dogs from shelters and find permanent homes for rescued pets. Proceeds from the event will towards funding food, shelter, and veterinary bills for rescued pets.</P>\n<P>****************************</P>\n<P>Before you buy your ticket, make sure you're buying tickets to the right session. Tickets can NOT be exchanged for another session 3/30/18. Tickets are non refundable.  Event is strictly 21 and over. No exceptions. Event is RAIN OR SHINE! <BR></P>\n<P>***************************</P>\n<P CLASS=\"p1\"><SPAN CLASS=\"s1\"><I><BR></I></SPAN></P>"
          },
