          "description": {
              "text": "SOLD OUT!! We've started a wait list and will reach out in order of response if any seats open up. Please fill out here.\n\nKCRW’s Moth Mainstage is hitting one of the oldest theatres in Los Angeles this March!  Watch wildly divergent storytellers merge entertainment and enlightenment on the 108 year old stage that still holds Harry Houdini's magical trap door. The Palace Theatre is not normally open to public, and the intimate, vertical seating design ensures no one is far from stage.\nThe event is open to all ages so everyone can come enjoy the inspiring, harrowing, and courageous storytellers. Since each story is true and every voice authentic, the show dances between documentary and theater, creating a unique, intimate, and often enlightening experience for the audience.\nNot a KCRW member? Good news! Your ticket purchase to The Moth Mainstage includes a 1 year membership!\nGolden Circle ticket buyers ($79) get a copy of The Moth’s new book Occasional Magic: True Stories About Defying the Impossible.",
              "html": "<P><STRONG>SOLD OUT!! We've started a wait list and will reach out in order of response if any seats open up.</STRONG><A HREF=\"https://docs.google.com/forms/d/e/1FAIpQLSf6grm5kKuy9gIQghUqkFJ476trvLA_OftTrQ56QYHm_ENKYQ/viewform?usp=sf_link\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\"><STRONG> Please fill out here.</STRONG><BR><BR></A></P>\n<HR>\n<P><BR>KCRW’s Moth Mainstage is hitting one of the oldest theatres in Los Angeles this March!  Watch wildly divergent storytellers merge entertainment and enlightenment on the 108 year old stage that still holds Harry Houdini's magical trap door. The Palace Theatre is not normally open to public, and the intimate, vertical seating design ensures no one is far from stage.</P>\n<P>The event is open to all ages so everyone can come enjoy the inspiring, harrowing, and courageous storytellers. Since each story is true and every voice authentic, the show dances between documentary and theater, creating a unique, intimate, and often enlightening experience for the audience.<BR></P>\n<P><SPAN><SPAN>Not a KCRW member? Good news! Your ticket purchase to The Moth Mainstage includes a 1 year membership!</SPAN></SPAN><BR></P>\n<P><SPAN><SPAN>Golden Circle ticket buyers ($79) get a copy of The Moth’s new book </SPAN><EM>Occasional Magic: True Stories About Defying the Impossible.</EM></SPAN></P>"
          },
