          "name": {
              "text": "Super Mamas Social 2019 ",
              "html": "Super Mamas Social 2019 "
          },
          "description": {
              "text": "\n\n\n\n\nThe Super Mamas are back with their 4th annual Super Mamas Social on May 11th 2019 in Downtown Los Angeles! Our Social is a gathering of strong mothers united to connect, inspire and support each other through the journey of womanhood.  It is a judgement free space where new, experienced and expecting mothers can come together to build new friendships and exchange knowledge to provide support for one another during the emotional ups and downs of motherhood\n\n\n\n\n\n\n\n\n\n\nJoin us for a day of  self care, fun, food, shopping and activities for the entire family.  Our Social includes a live taping of the Super Mamás Podcast featuring some of the fabulous women behind the powerful stories you’ve heard on the show plus a couple other surprise guests.  We will also have interactive and powerful installations by our incredible brand partners. Get pampered,  meet and mingle with some of your most beloved members of our Mom Tribe and create long lasting relationships with like-minded mamas from all walks of life.\nThis day was created for YOU. It is our intention to create a space for our moms to connect with one another and create long and lasting friendships.  As moms, we know how lonely motherhood can sometimes be.  One day you wake up in an an entire new neighborhood (mama hood) that can make you feel out of place.  We want you to leave any insecurities at the door, and live your best life meeting new friends, getting pampered all while enjoying a michelada.  Come with an open heart and watch your life change!\n\n\n\n\n",
              "html": "<DIV CLASS=\"sqs-col sqs-col-6\">\n<DIV CLASS=\"yui3-widget yui3-block-base yui3-block-parent-base sqs-block-html sqs-block html-block\">\n<DIV CLASS=\"sqs-block-html-content sqs-block-content\">\n<DIV CLASS=\"sqs-dd-invalid-handle yui3-widget sqs-html\">\n<DIV CLASS=\"sqs-html-content\">\n<P><STRONG>The Super Mamas are back with their 4th annual Super Mamas Social on May 11th 2019 in Downtown Los Angeles!</STRONG> Our Social is a gathering of strong mothers united to connect, inspire and support each other through the journey of womanhood.  It is a judgement free space where new, experienced and expecting mothers can come together to build new friendships and exchange knowledge to provide support for one another during the emotional ups and downs of motherhood</P>\n</DIV>\n</DIV>\n</DIV>\n</DIV>\n</DIV>\n<DIV CLASS=\"sqs-col sqs-col-6\">\n<DIV CLASS=\"yui3-widget yui3-block-base yui3-block-parent-base sqs-block-html sqs-block html-block\">\n<DIV CLASS=\"sqs-block-html-content sqs-block-content\">\n<DIV CLASS=\"sqs-dd-invalid-handle yui3-widget sqs-html\">\n<DIV CLASS=\"sqs-html-content\">\n<P>Join us for a day of  self care, fun, food, shopping and activities for the entire family.  Our Social includes a live taping of the Super Mamás Podcast featuring some of the fabulous women behind the powerful stories you’ve heard on the show plus a couple other surprise guests.  We will also have interactive and powerful installations by our incredible brand partners. Get pampered,  meet and mingle with some of your most beloved members of our Mom Tribe and create long lasting relationships with like-minded mamas from all walks of life.</P>\n<P>This day was created for YOU. It is our intention to create a space for our moms to connect with one another and create long and lasting friendships.  As moms, we know how lonely motherhood can sometimes be.  One day you wake up in an an entire new neighborhood (mama hood) that can make you feel out of place.  We want you to leave any insecurities at the door, and live your best life meeting new friends, getting pampered all while enjoying a michelada.  Come with an open heart and watch your life change!</P>\n</DIV>\n</DIV>\n</DIV>\n</DIV>\n</DIV>"
          },
