          "name": {
              "text": "LA Made: Black Angeleno Trailblazer Families",
              "html": "LA Made: Black Angeleno Trailblazer Families"
          },
          "description": {
              "text": "Join us for a fascinating panel discussion about the cultural and civic impact of African-American residents on the history of Los Angeles. Sherwin “Keith” Rice--historian and archivist at the Tom & Ethel Bradley Center located at California State University, Northridge--will provide the historical context for the panel discussion, which will be moderated by Tyree Boyd-Pates, curator at the California African American Museum.\n\nThe impetus for this program was Los Angeles Public Library's recent digitization of The Liberator, one of L.A.’s early African-American newspapers, owned and edited by Jefferson Edmonds. His descendent, Arianne Edmonds, will participate in the discussion, along with Tina Watkins-Quaye, whose grandfather Ted Watkins founded the Watts Labor Community Action Committee. With special guest Jackie Broxton, Executive Director of the Biddy Mason Charitable Foundation. \n\nA related exhibition, The Liberator: Chronicling Black Los Angeles, 1900–1914, will be on display at the California African American Museum from March 20-September 8, 2019.",
              "html": "<P><SPAN>Join us for a fascinating panel discussion about the cultural and civic impact of African-American residents on the history of Los Angeles. </SPAN>Sherwin “Keith” Rice--historian and archivist at the Tom &amp; Ethel Bradley Center located at California State University, Northridge--will provide the historical context for the panel discussion, which will be moderated by Tyree Boyd-Pates, curator at the California African American Museum.</P>\n<P><BR></P>\n<P CLASS=\"MsoNormal\"><SPAN>The impetus for this program was Los Angeles Public Library's recent digitization of <I>The Liberator, </I>one of L.A.’s early African-American newspapers, owned and edited by Jefferson Edmonds. His descendent, Arianne Edmonds, will participate in the discussion, along with Tina Watkins-Quaye, whose grandfather Ted Watkins founded the Watts Labor Community Action Committee. W<SPAN>ith special guest Jackie Broxton, Executive Director of the Biddy Mason Charitable Foundation. </SPAN></SPAN></P>\n<P CLASS=\"MsoNormal\"><BR></P>\n<P CLASS=\"MsoNormal\"><SPAN><SPAN><SPAN>A related exhibition, </SPAN><SPAN><EM>The Liberator: Chronicling Black Los Angeles, 1900–1914,</EM> </SPAN><SPAN>will be on display at the California African American Museum from March 20-September 8, 2019.</SPAN></SPAN></SPAN></P>"
          },
